import { useNavigate } from "react-router-dom";
import logo from "../../assets/logo.png";
import Navbar from "../../components/Navbar/navbar";
import Button from "../../components/Button/button";
import ovo from "../../assets/imagePGI.png";
import React from "react";
import "./learn.css";

// Recursive Tree Component
const TreeNode = ({ node, x = 0, y = 0, parentX = null, parentY = null }) => {
  const childXOffset = 100; // Space between siblings
  const childYOffset = 100; // Space between levels

  return (
    <div>
      {/* Connection line if there's a parent */}
      {parentX !== null && parentY !== null && (
        <svg
          style={{
            position: "absolute",
            overflow: "visible",
            zIndex: -1,
          }}
        >
          <line
            x1={parentX + 25}
            y1={parentY + 25}
            x2={x + 25}
            y2={y}
            stroke="black"
          />
        </svg>
      )}

      {/* Render the current node */}
      <div
        style={{
          position: "absolute",
          left: x,
          top: y,
          width: "50px",
          height: "50px",
          backgroundColor: "#ffecb3",
          borderRadius: "50%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          border: "1px solid #ffca28",
          fontSize: "20px",
        }}
      >
        {node.label}
      </div>

      {/* Render child nodes recursively */}
      {node.children &&
        node.children.map((child, index) => (
          <TreeNode
            key={index}
            node={child}
            x={x + index * childXOffset - (node.children.length - 1) * (childXOffset / 2)}
            y={y + childYOffset}
            parentX={x}
            parentY={y}
          />
        ))}
    </div>
  );
};

// Main Learn Component
export default function Learn() {
  const navigate = useNavigate();

  // Tree data for the egg tree
  const treeData = {
    label: "üç≥",
    children: [
      {
        label: "üç≥",
        children: [
          { label: "üç≥" },
          { label: "üç≥" },
        ],
      },
      {
        label: "üç≥",
      },
    ],
  };

  return (
    <>
      <Navbar />
      <div className="ola">
        <img src={ovo} alt="ovo" />
        <div className="botDiv">
          <div className="sideInfo">
            <h1>Descobre novos pratos todos os dias</h1>
            <p className="textInfo">
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed maximus non turpis vitae pellentesque.
            </p>
            <Button click={() => navigate("/learn")} />
          </div>
        </div>

        {/* Egg Tree Section */}
        <div
          style={{
            position: "relative",
            height: "400px",
            width: "600px",
            margin: "50px auto",
          }}
        >
          <TreeNode node={treeData} x={275} y={20} />
        </div>
      </div>
    </>
  );
}
